import './App.scss';
import Searchbar from './components/Searchbar/Searchbar';
import background from './assets/teemo-background.png'

function App() {
  return (
    <div className='App' >
      <div className='bg' style={{ backgroundImage: `url(${background})`}}></div>
      <Searchbar />
    </div>
  );
}

export default App;
